import './App.css';
import Navbar from './Navbar';
import Home from './Home';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
function App() {
  var name = 'qmars';
  const title = `Welcome to ${name}`;
  return (
    <div className="App">
      <Navbar title={title} />
      <div className="content">
        <Router>
          <Routes>
            <Route path="/" element={<Home />} />
          </Routes>
        </Router>
      </div>
    </div>
  );
}
export default App;
